import React from "react";
import { Link } from "react-router-dom";
import "./navi.css"

export default function Navi() {

 
 const naviList=[
  ["Hakkımızda", "/about"],
  ["Hizmetler","/services"],
  ["İletişim","/contact"],
  ["Fiyatlar","prices"],
].map((list,url)=>
    <li className="float-left list-none pr-8 text-xl ">
      <Link className="text-white border-b-2 border-red-300 hover:text-slate-400" to={url}> {list}</Link>
    </li>
);


  return (
    <nav className="main-nav">
      <div className="bg-red-300 w-52 h-24 -mt-4   rounded-r-2xl">
        <h1 className="text-white font-bold text-2xl float-left pl-10 pt-7 text-center">
          HTC Güzellik <br/> Salonu
        </h1>
      </div>
      <ul className="float-right -mt-12">{naviList}</ul>
    </nav>
  );
}
